description:
Wario World's gameplay centers mainly on combating enemies, although it requires some platform navigation similar to Super Mario 64 and Super Mario Sunshine.

This came out only on the GameCube console, but emulates very well on PC.

All the settings are already set for the game, if you screw up the settings for some reason, I have included pictures of the original settings.

Xpadder with profiles for Xbox360 &amp; PS3 included.


I recommend:

Core 2 duo 2.4 GHz CPU or higher

AMD ATI HD 5 series graphics card or higher.

At least 3 GIG of ram.

Windows XP / 7 32 bit


